import React from 'react';
import Main from '../components/layouts-fo/Main';
import Blank from '../components/layouts-fo/Blank';

import MainView from '../views/Main';
import MinorView from '../views/Minor';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
  useHistory,
  useLocation
} from "react-router-dom";

import { IndexRedirect, browserHistory} from 'react-router';

export default (
    <Router>
        <Switch>
          <Route path="/">
            <MainView />
          </Route>
          <Route path="/main">
            <MainView />
          </Route>
          <Route path="/minor">
            <MinorView />
          </Route>
        </Switch>
    </Router>

);
